('CS1', 'Basic Webcam', 'Image Processing', 'A basic WebCam Software for simple editing and capturing functions', 'webcam functions simple basic editing capturing software', 'In this Basic Webcam Software Image would be captured using webcam(Laptop).Then image could be processed using various tools like colour formats , pixels ,cropping etc. Further options for capturing videos and storing images and videos will be there. Editing of saved images and captured images could be done too. The Programming Language used will be Python and various Libraries like numpy , tkinter , opencv2 will be used. numpy is for changing image into form of binary numbers such that changes could be done with Image and Video. Tkinter is for GUI support in Python.Opencv2 is used for Capturing Images and Videos.', '["Programming Language","Support Vector Machine","Software Engineering","Software Systems","Image Processing","Software Development","Image Sequence","Image Segmentation","Software Architecture","Image Analysis","Image Features","Software Component","Image Database","Image Compression","Image Retrieval","Language Model","Video Coding","Image Coding","Software Tool","Software Design","Software Package","Image Quality","Video Streaming","Support Vector","Programming Model","Image Representation","Software Agent","Software Testing","Programming Environment","Tool Support","Basic Research","Basic Linear Algebra Subprograms"]', 'Dr. R. Jebakumar', 'Amritpreet Singh,Jitender Narwal,Naman Sharma', 'singhamritlove@gmail.com', '9962626276', 'Ongoing', '2016-05-08 09:12:01'),
('CS10', 'Rental House Web Portal', 'Web Developement', 'It is an internet portal dedicated to meet every aspect of the consumers needs in the Real Estate industry', 'real dedicated estate consumers industry portal needs every aspect internet meet', 'Online Rental House Web Portal is an internet portal dedicated to meet every aspect of the consumers needs in the Real Estate industry. It is a forum where Property Owners, Brokers, Tenants and Investors can exchange information, quickly, effectively and inexpensively. It features residential properties for sale rent and lease the fore properties, rates, locations, and also major events and happenings in the genre are the highlights of this portal. The portal provides real estate directory for real estate agents, property dealers, builders and potential buyers of property. Search based on keywords such as location, prices. Customized user accounts that can be dynamically generated. Comparison of properties based on location (distance from nearest hospital, school, airport, railway station etc). The registered users must be able to view the history and summary of their activities. The brokers/owners shall be provided with a form to update their property details.', '["Real Time","User Interface","Web Service","Real Time Systems","Web Pages","Search Space","Search Engine","Nearest Neighbor","Search Algorithm","Real Time Application","Real World Application","User Interaction","User Study","Distance Measure","Search Strategy","Web Search","User Model","Search Method","Internet Protocol","User Preferences","Distance Function","Web Search Engine","Internet Application","Aspect Oriented Programming","Search Trees","User Needs","User Interface Design","User Experience","Location Awareness","Distance Metric","Web Portal","House of Quality","Housekeeping Gene","Portal Vein","Portal Hypertension","Rental Housing"]', 'Dr. R. Jebakumar', 'Rishabh Kumar Jain, Harshit Soni, Ashish Dhaka', 'rishabhkumar.03@gmail.com', '8636362726', 'Ongoing', '2016-05-08 16:52:52'),
('CS11', 'Expense Manager', 'Database management system', 'It is a windows based application that lets us record all of our personal expenses.', 'based record windows us expenses application lets personal', '"Expense tracker is a windows based application that lets us record all of our personal expenses. It helps in managing our finances and generate reports accordingly. \nThe system is very easy to operate. We can add new accounts by simply clicking the Add button and entering account details and any associated comments. We can also view the expenses that have already been entered and generate reports on the same.\nThis system provides us with a user friendly computerized interface with which a particular data can be retrieved with ease.', '["User Interface","Graphic User Interface","User Interaction","Mobile User","Application Development","User Study","Personal Computer","Multi User","Additive Noise","User Model","Use Case","Additive White Gaussian Noise","Multiuser Detection","User Preferences","Ease of Use","Interface Design","User Needs","User Interface Design","User Experience","User Behavior","User Profile","User Requirements","User Cooperation","Application Program Interface","User Satisfaction","User Mobility","Personal Digital Assistant","Primary User","User Acceptance","Usability Engineering","Managerial Compensation","Managerial Incentive"]', 'Ms. R. Mangalagowri', 'Sansriti Shukla,Deepshi Mahajan', 'Sansritishukla234@gmail.com', '8687686776', 'Completed', '2016-05-08 16:57:45'),
('CS12', 'RAILWAY BOOKING', 'JAVA APPLICATIONS', 'General information on railway reservation booking', 'reservation information railway booking general', 'In modern day to day life travelling has become a key part in every one''s life and major way of transportation for common being the railways has its portal for online booking of tickets.This railway booking portal has user interface for easy booking with java and back end java container serverlet,my SQL .', '["backpropagation","Java Programming","Life Cycle","Back Propagation","End To End Delay","Interface Design","Key Distribution","Key Management","Online Algorithm","Java Virtual Machine","Keyword Search","Online Learning","Background Knowledge","Key Exchange","Common Sense","Online Community","Background Subtraction","Present Day","backpropagation algorithm","Transportation Networks","Everyday Life","Background Modeling","java bytecode","Common Property","Java Language","Key Agreement","Key Establishment","Majority Voting","Travelling Salesman Problem","Life Sciences"]', 'Ms. R. Mangalagowri', 'D.Madhava varma,B bharath chandra reddy', 'dmadhavvarma3@gmail.com', '7867998989', 'Ongoing', '2016-05-08 17:00:21'),
('CS13', 'Super Search', 'Search Engine', 'This is a simple search Engine', 'simple engine search', 'Initially data is entered which gets stored in database. When a query is raised, it is matched from the one stored in database', '["Database System","Search Space","Search Engine","Query Language","Query Processing","Supervised Learning","Query Optimization","Database Management System","Database Design","Matched Filter","Query Answering","Query Evaluation","Database Query","superscalar processor","Database Management","Query Expansion","Database Search","Query Formulation","Database Integration","Query By Example","Query Logs","Query Complexity","Query Translation","Query Refinement","Query Rewriting","Query By Image Content","Query Reformulation","Database Security","Query Routing","Database Programming Languages","Database Replication","Query By Content","Database Marketing","Query By Humming"]', 'Ms. R. Mangalagowri', 'Saurabh Singh,Venu Gopal Sunkara', 'saurabh_rampratab@srmuniv.edu.in', '8848743743', 'Ongoing', '2016-05-08 17:02:41'),
('CS14', 'Intelligent Speed Adaptation', 'Image Processing', 'Intelligent Speed Adaptation is any system that ensures that vehicle speed does  not exceed a safe orlegally enforced speed.', 'or ensures intelligent safe system adaptation exceed vehicle legally speed enforced', 'In case of potential speeding, a human driver can be alerted, or the speed reduced automatically. Our intention here is to make a model of this with an object that moves and the speed is calculated by the judgment of its next position. This application can also find the position of that object with respect to its original position. Its applications are numerous which includes traffic, sports where the speed of a ball or the swing of a racquet, bat etc is calculated. With the technology of image processing, the above applications are made possible.', '["Object Oriented","Image Processing","Objective Function","Image Sequence","Image Segmentation","Object Recognition","Human Computer Interaction","Next Generation","Image Analysis","Image Features","Object Oriented Programming","Image Database","Object Model","Image Compression","Image Retrieval","Image Coding","Image Quality","Intelligent Agent","Application Development","Object-oriented Language","Intelligent System","Image Representation","Object Detection","Image Restoration","Image Registration","Object Oriented Design","Digital Image Processing","Traffic Model","Human Factors","Human Body","Traffic Engineered","Humanoid Robot","Speed of Convergence","Speed Control","Adaptation and Learning","Intelligent Speed Adaptation"]', 'Ms. R. Mangalagowri', 'Nancy Lath, Rakhi Yadav, Ch. Yashasvy Kanvas', 'rakhi.yadav138@gmail.com', '8654586787', 'Ongoing', '2016-05-08 17:04:56'),
('CS15', 'Accuracy constrained privacy preserving access control mechanism for relational data', 'Java Database Connectivity(JDBC)', 'Access control mechanisms protect sensitive information from Unauthorized Users.', 'control information protect users unauthorized mechanisms access sensitive', 'It Protects sensitive information from unauthorized users.However, when sensitive information is shared and a privacy protection mechanism (PPM) is not in place,an  authorized user can still compromise the privacy of a person leading to  identity disclosure.PPM can use suppression and generalization of Relational Data to anonymize and satisfy privacy control requirements.', '["User Interface","Shared Memory","Relational Database","Access Control","User Interaction","User Study","Personal Computer","User Model","Relational Model","Relational Data","Shared Memory Multiprocessor","Constrained Optimization","Access Point","User Preferences","User Needs","User Interface Design","User Experience","User Behavior","User Profile","User Requirements","Mechanism Design","Constrained Optimization Problem","Relational Database System","User Cooperation","Generalization Error","Privacy Preservation","User Satisfaction","User Mobility","Personal Digital Assistant","Privacy Protection","User Acceptance","User Feedback","Generalization Capability","Identity Based Encryption","Privacy Preserving Data Mining","Test Access Mechanism","Accuracy Analysis","Accuracy Assessment","Mechanism of Action","privacy-preserving datamining"]', 'Mrs.S. S.Saranya', 'C.MANEESHA,K.AKSHATA,CH.VAMSI', 'akshatakavali919@gmail.com', '76675458657', 'Ongoing', '2016-05-08 17:08:46'),
('CS16', 'File Format Converter', 'Application Software', 'A utility softwae that converts various formats to .pdf format (which is officially accepted everywhere) without any online support', 'accepted format everywhere support online without various softwae formats converts pdf officially utility', 'In a computer, a file format is the layout of a file in terms of how the data within the file is organized. A program that uses the data in a file must be able to recognize and possibly access data within the file. Conventionally, the extension is separated by a period from the name and contains three or four letters that identify the format. A program that uses or recognizes a particular file format examine the bits in the file to see whether the format (layout) is the one it recognizes. There are as many different file formats as there are different programs to process the files. A few of the common file formats are: Word documents (.doc) ,Web text pages (.htm or .html) ,Web page images (.gif and .jpg) ,Adobe Acrobat files (.pdf) ,Executable programs (.exe).\nFast access to different file formats is necessary for editing and fast retrieval of documents. However, there are many online file converters but issues like- slow/no internet connections, huge file retrievals, uploading and then downloading the required files creates problem and consumes time. High resolution files are not supported by each and every device\nToday, .pdf is the most common file format officially accepted but since some low edge devices like printers/scanners (old) cannot read the containing bytes ,the format needs to be converted for our convenience. To resolve all these issues a software which deals with Interfile conversion which supports the following formats would be appropriate.\nWord documents (.doc)Adobe Acrobat files (.pdf) Text document (.txt), Rich text format (.rtf). Power point presentation(.ppt)\nThe conversion includes bit level manipulation so that each bit is accurately retrieved. Prospectively, the use of a file converter using its basics could also extend to the areas of speech- to  text, handwriting  to- text etc. The vastness could expand to the usage of this simple concept into upcoming technologies like Artificial Intelligence.', '["Programming Language","Lower Bound","Computer Vision","Artificial Intelligent","Software Engineering","Software Systems","Software Development","Computer Graphic","Web Service","Speech Recognition","Computer Simulation","Low Power","Computer Program","Computer Network","Web Pages","Software Architecture","Computer Model","Artificial Neural Network","Bit Error Rate","Access Control","Fast Algorithm","Low Complexity","File System","Computer Architecture","Edge Detection","Necessary and Sufficient Condition","Software Component","Computer Experiment","Software Tool","Software Design","File Sharing","Formation Control","Formative Evaluation","Converter Control","Mobile Information Device Profile"]', 'Ms. R. Mangalagowri', 'Chahat Chauhan(1031310517), Swagnika Bhattacharjee(1031310524), Gopal Daingla(1031310622)', 'swagnika1995@gmail.com', '787878899', 'Ongoing', '2016-05-08 17:11:02'),
('CS17', 'Explora  a project analyser', 'Text Mining', 'An application that analyses the projects', 'application analyses projects', 'The project aims at building a portal for CSE Department of SRM University to categorize the projects as well as bring people of similar research area together. The project shall enable the students to upload the details of their project and find out the similar projects done in the past for reference or projects being pursued simultaneously by other students. It shall also enable the department to provide help in the form of project reports which shall enable the students to perform future enhancements proposed by earlier projects to be pursued and taken forward into a better product. Details of the faculties shall be available with their research domains. Students can choose the faculty as their guide and give details like project title, description, abstract etc. Based on the description, each project shall be associated with some tags which shall be used to identify projects using similarity based retrieval. The reports of similar projects can be used for multiple functions.', '["Performance Evaluation","Performance Analysis","Performance Improvement","Building Block","Performance Measure","Similarity Measure","Multiple Input Multiple Output","Multiple Access","Description Logic","Performance Comparison","Performance Model","Performance Metric","Multiple Objectives","Abstract Interpretation","Performance Guarantee","Abstract Data Type","Multiple Views","Reference Model","Project Manager","Performance Bounds","Performance Prediction","Production System","Performance Optimization","Similarity Search","Similarity Function","Multiple Sequence Alignment","Multiple Access Channel","Product Line","Exploratory Data Analysis","Projection Method","Exploratory Study"]', 'Dr.C.N.Subalalitha', 'Ayush Aggarwal(1031310523), Rishav Medhi (1031310540), Sagar Sahni(1031310543)', 'ayush.agarwal7689@gmail.com', '9003242271', 'Ongoing', '2016-05-08 17:17:16'),
('CS18', 'SRM Search Engine', 'Natural Language Processing, Text Mining, Web Development, Machine Learning', 'A cluster based search engine for the Indian web', 'engine web search based cluster indian', 'SRM Search engine aims at creating a searching platform for the Indian web. Along with search results, it provides clusters for the search queries and also smart answers if exists for the query. It uses multiple kinds of databases and natural language processing tools to answer user queries. Machine learning algorithms are used to provide auto suggestions to user queries. The data for databases are provided by crawlers that scan web pages over the web.', '["Machine Learning","User Interface","Learning Algorithm","Web Service","Natural Language","Automatic Generation","Web Pages","Search Space","Search Engine","Query Language","Search Algorithm","Query Processing","Multiple Input Multiple Output","Multiple Antennas","Natural Language Processing","Language Model","Multiple Access","User Interaction","Autonomous Agent","Query Optimization","User Study","Search Strategy","Web Search","User Model","Search Method","Learning Methods","Natural Images","Machine Vision","Multiple Objectives","Machine Translation","Web Search Engine","Engineering Design","Engineering System","meta search engine","Natural Sciences and Engineering Research Council","Search Based Software Engineering","Search Engine Optimization","Engineering Research Center","Engineering Education Research","Cold Regions Research and Engineering Laboratory","Engineer Research and Development Center"]', 'Ms. R. Mangalagowri', 'Ayush Aggarwal, Rishav Medhi, Tilak Patidar, Varun Dey, Anmol Sachan, Akhil Gupta, Tasdik Rahman, Rishav Mishra, Devraj Phukan', 'tilakpatidar@gmail.com', '7823874238', 'Ongoing', '2016-05-08 17:45:30'),
