('CS2', 'Library Management System', 'Web Development', 'It is an online library management system.', 'management system library online', '"As the name suggests, our project is based is a web based library system particularly designed for CSE department so as to provide efficient management of books and effective deployment of the resources to the students.\nThe Admin panel has the login system to keep the library updated. Teachers can search through the records and check the availability of the book.\nOur application is programmed using HTML, CSS, Jquery and JavaScript for the front-end and PHP, MySQL for the back-end. Website will be responsive and can be controlled by mobile as well.\nWith the addition of other features, the management system will be of great use to faculty in the department. It will make the process of issuing books much easier and books."', '["Efficient Algorithm","Mobile Robot","Web Service","Mobile Ad Hoc Network","Web Pages","Search Space","Mobile Computer","Search Engine","Search Algorithm","Efficient Implementation","Mobile Device","backpropagation","Mobile Network","Mobile Agent","Management System","Front End","Mobile User","Application Development","Search Strategy","Mobile Node","Web Search","Search Method","Mobile Phone","Mobile Host","Mobile Communication","Back Propagation","End To End Delay","Web Search Engine","Mobile Environment","Search Trees","Management Information System","Library Design","Library and Information Science"]', 'Dr. R. Jebakumar', 'Abhishek Dua , Sonali Pasbola', 'intrepid.sunny@gmail.com', '9003227017', 'Ongoing', '2016-05-08 09:13:25'),
('CS20', 'Search Engine', 'Natural Language Processing', 'It is a search engine', 'engine search', 'SRM Search engine aims at creating a searching platform for the Indian web. Along with search results, it provides clusters for the search queries and also smart answers if exists for the query. It uses multiple kinds of databases and natural language processing tools to answer user queries. Machine learning algorithms are used to provide auto suggestions to user queries. The data for databases are provided by crawlers that scan web pages over the web.', '["Machine Learning","User Interface","Learning Algorithm","Web Service","Natural Language","Automatic Generation","Web Pages","Search Space","Search Engine","Query Language","Search Algorithm","Query Processing","Multiple Input Multiple Output","Natural Language Processing","Language Model","Multiple Access","User Interaction","Autonomous Agent","Query Optimization","User Study","Search Strategy","Web Search","User Model","Search Method","Learning Methods","Natural Images","Machine Vision","Multiple Objectives","Machine Translation","Engineering Design","Engineering System"]', 'Ms. R. Mangalagowri', 'Sagar', 'hello.sagarsahni@gmail.com', '77282552727', 'Ongoing', '2016-05-09 06:15:58'),
('CS3', 'To  create  a  semantic  search engine  based on wikipedia  articles.', 'Natural Language Processing', 'Building a search engine using wikipedia corpus', 'building engine search wikipedia using corpus', 'Wikipedia  is  unarguably the  biggest  knowledge  repository  of the  world, offered in  more  than  200 languages. Over the  time  it  has  also been  widely used for natural  language  processing  and big data applications.  We  aim  to create  a  semantic  search  engine  for wikipedia  articles  as  wikipedia''s  own search is  only  limited to  full  text  search  and only title  search.  This  search  engine  will  be  able  to answer  direct  queries  as  well  as  questions  about  a  wikipedia  entity. It  utilizes  semantic  relatedness measures  to  emphasize  articles  and  connections  that  are  most  likely  to be  of interest, visualization to expose  the  structure  of how  the  available  information is  organized, and lightweight  information retrieval  to provide  relevant  results. Utilizing  the  sematic  graphs  obtained  from  wikipedia  articles  it can answer relational  queries  and will  be  able  to disambiguate  queries  based on popularity.', '["World Wide Web","Natural Language","Semantic Web","Search Space","Search Engine","Relational Database","Search Algorithm","Local Search","Natural Language Processing","Directed Graph","Language Model","tabu search","Texture Mapping","Search Strategy","Web Search","Search Method","Relational Model","Text Categorization","Relational Data","Natural Images","Operations Research","Text Retrieval","Structured Data","Research and Development","Semantic Information","Direct Manipulation","Text Classification","Heuristic Search","Web Search Engine","Search Trees","Engineering Design","Engineering System","Semantic Search","meta search engine","Natural Sciences and Engineering Research Council","Search Based Software Engineering","Search Engine Optimization","Engineering Research Center","Engineering Education Research","Cold Regions Research and Engineering Laboratory","National Center for Research On Earthquake Engineering","Engineer Research and Development Center","Pacific Earthquake Engineering Research"]', 'Dr. R. Jebakumar', 'Tilak Patidar 1031310537,Varun Dey 1031310177', 'tilakpatidar@gmail.com', '8608988732', 'Ongoing', '2016-05-08 09:15:06'),
('CS4', 'Decoding and Classification of Human Emotional Behavior on influence of different type of Music', 'Artificial Intelligence(Brain Computer Interfacing and Neural Nets )', 'To be able to understand and classify the human emotional behavior based on the evoked potential for different types of music and to determine if emotional behavior can be manipulated based on influence of music genre.', 'different based human music influence able determine manipulated evoked potential understand types behavior genre emotional classify', '"Music has an undeniable impact on the human brain. Not only does it help to build concentration, but it also helps to enhance ones numerical abilities. Similarly, it can also affect an individuals emotional state and mood.\nUnderstanding the effect of different types of music(tunes) categories on human emotional behavior and then using this data to influence emotional behavior using different types of sounds could play an important role in the near future. The study can be used for therapeutic purposes. For instance, to help individuals affected by depression, mental tension and so on.\n\nThe human brain is like a machine which emits signals based on the input that has been given. Based on the frequencies these signals are classified into the following six categories - Delta, Theta, Gamma, Alpha, Mu and Beta. These waves can be interpreted using Electroencephalogram(ECG). The deduced graph from the ECG will then be used for analysis and study. \n\nFrom our analysis and study we expect to find a strong correlation amongst music and human emotion, which can then be used to influence an individuals mood, depending on their current mood. We aim to use the above stated hypothesis for therapeutic and rehabilitation purpose.\n\nDifferent frequencies have different effects on the brain. We know, the brainwaves are generally classified into broad categories, each has its own characteristic frequency band. These frequencies often influence the emotional state we are in. Therefore, by observing the relationship between the frequencies and emotions, we can correlate which frequency corresponds to which emotion. This would help us to relate different kinds of music with various emotions. \n\nUsing the determined relationship between various types of music and the different known human emotions, we will design a neural net based semi-supervised classification algorithm to compute classifier threshold for each individuals and to change the emotional state of the subject for the better. Changes are expected in the inference of data that is observed when a person is not exposed to a particular music and when he is.\nExpected Result- To show that music does influence emotions, build a system that can classify current human emotional state and use specific music to transition emotional behavior to a desired state.', '["Neural Network","Machine Learning","Computer Vision","User Interface","Design and Implementation","Knowledge Base","Computer Graphic","Computer Simulation","Computer Program","Building Block","Input Output","Computer Network","Network Topology","Human Computer Interaction","Computer Model","Artificial Neural Network","Multi Agent System","Knowledge Representation","Nearest Neighbor","Frequency Domain","Design Methodology","Computer Architecture","Multiple Input Multiple Output","Supervised Learning","Design Process","Mutual Information","Numerical Simulation","Multiple Antennas","Multi Dimensional","Numerical Experiment","Type System","Classification Accuracy","Human Factors","Classification Algorithm","Type Checking","Behavior Modeling","Music Information Retrieval","Musical Instruments","Behavioral Synthesis","Influence Diagram","Emotional Expression","Influence Function","Emotional Intelligence","Human Factors Analysis and Classification System"]', 'Dr. R. Jebakumar', 'Akshay Gugnani, 1031310534, III-CSE-I', 'akshaygugnani@gmail.com', '9962646581', 'Ongoing', '2016-05-08 09:17:37'),
('CS5', 'Stock Market Module', 'Neural Networks', 'Basics of how the stock market and investments work.', 'work basics investments market stock', 'The monitory value of each and every product or service is directly or indirectly dependent on the stock  market which basically deals with the currency value in market. However, the investors should be able to decide which product or service they have invest in depending upon the share possibilities. We use a simple neural network to predict the shares and provide the data to the investors so they can decide on which they have to invest. By providing information about the present and past share market we thus by cautioning the clients in their investments in the market on an product.', '["Neural Network","Network Topology","Artificial Neural Network","Shared Memory","Service Provider","Network Traffic","Network Performance","Network Architecture","Network Model","Network Design","Network Connectivity","Network Protocol","Prediction Accuracy","Prediction Model","Neural Net","Network Flow","Shared Memory Multiprocessor","Prediction Error","Network Services","Network Structure","Neural Network Model","Networked Systems","Recurrent Neural Network","Network Security","Network Coding","Network Simulator","Network Management","Network Capacity","Service Oriented Architecture","Network Lifetime","Stock Market","Module System","Stock Price"]', 'Dr. R. Jebakumar', 'GOTIMUKUL VENKATESH(1031310507),P NAVEEN KUMAR(1031310514),P SAI MANI TARUN(1031310546)', 'venkateshganu@gmail.com', '9876725266', 'Ongoing', '2016-05-08 11:31:03'),
('CS6', 'Text Summarization for news', 'Natural Language Processing', 'Summarizing the news bulletin to provide the key news', 'provide news summarizing key bulletin', 'The task of a text summarizer is to produce a synopsis of any document (or set of documents) submitted to it. The level of sophistication of a synopsis can vary from a simple list of isolated keywords that indicate the major content of the document(s), through a list of independent single sentences that together express the major content, to a coherent and generate text that compresses the document(s). The more sophisticated a synopsis, the more effort it generally takes to produce. Summarization is a very interesting and useful task that gives support to many other tasks as well as it takes advantage of the techniques developed for related Natural Language Processing tasks. With these set of tools we aim at summarizing the news and providing just the key information.', '["Support Vector Machine","Natural Language","Natural Language Processing","Expressive Power","Language Model","Independent Component Analysis","Support Vector","Texture Mapping","Text Categorization","Content Based Image Retrieval","Natural Images","Text Retrieval","Support System","Text Classification","Task Scheduling","Content Based Retrieval","Key Distribution","Document Retrieval","Texture Features","Key Management","Texture Analysis","Text Mining","Natural Extension","Language Use","Language Design","Tools and Techniques","Processing Element","Web Documents","Content Analysis","Natural Scenes","Text Summarization","Automatic Text Summarization"]', 'Dr. R. Jebakumar', 'Aditya', 'aditya.ada@gmail.com', '9962646381', 'Ongoing', '2016-05-08 16:29:00'),
('CS7', 'Cricket match results prediction using Machine Learning Techniques', 'Machine Learning', 'Using the logistic and linear regression models, we can predict the match Win, Loss and numerical figures of the Target and other data', 'loss linear models win numerical predict figures logistic using data regression match target', '"Machine learning is a subfield of Computer science that evolved from the study of pattern recognition and computational learning theory in artificial intelligence. It explores the study and construction of algorithms that can learn from and make predictions on data. The project involves the essence of this concept of machine learning. Using the logistic and linear regression models, we can predict the match Win, Loss and numerical figures of the Target and other data. The prediction is based on the available statistics which are used in the algorithms for calculation of results. The application is highly accurate in its prediction.', '["Machine Learning","Computational Complexity","Pattern Recognition","Computer Vision","Artificial Intelligent","Learning Algorithm","Linear Program","Computer Graphic","Computer Simulation","Computer Program","Computer Network","Computer Model","Linear System","Linear Time","Artificial Neural Network","Computer Architecture","Numerical Simulation","Numerical Experiment","Numerical Solution","Computational Geometry","Pattern Classification","Pattern Matching","Linear Matrix Inequality","Numerical Method","Computer Experiment","Linear Equations","Computational Efficiency","Conceptual Model","Computational Method","Application Development","Prediction Accuracy","Prediction Model","Learning Methods","Machine Vision","Matched Filter","Matching Pursuit","Statistical Machine Learning","Supervised Machine Learning","Genetics Based Machine Learning","Extreme Learning Machine","Prediction By Partial Match","Unsupervised Machine Learning"]', 'Dr. R. Jebakumar', 'Abhinav Rajput , B.Aditya, Adnan Gouhar', 'rajputabhinav1994@gmail.com', '9962625636', 'Ongoing', '2016-05-08 16:32:18'),
('CS8', 'Digit Recognition using Python', 'Image processing,Machine learning', 'Recognizing the numbers present in a image', 'recognizing image numbers present', 'Digit recognition is one of the active research topics in digital image processing. It is a classic machine learning problem. The goal of this project is to take an image of handwritten digits and determine what those digits are. The principal task in digit recognition is to extract HOG features from the database of handwritten digits and to build a classifier on it. Then we predict the digits of the database using this classifier. To build the classifier we write python scripts.', '["Machine Learning","Learning Algorithm","Image Processing","Database System","Building Block","Image Sequence","Image Segmentation","Principal Component Analysis","Image Analysis","Image Features","Digital Image","Image Database","Image Compression","Image Retrieval","Digital Communication","Image Coding","Digital Library","Image Quality","Digital Systems","Prediction Accuracy","Prediction Model","Digital Signature","Image Representation","Learning Methods","Digital Signal Processing","Image Restoration","Machine Vision","Database Management System","Machine Translation","Learning Process","Handwritten Digit Recognition","Recognition Primed Decision","Recognition Memory"]', 'Dr. R. Jebakumar', 'B.Balaji ,Brainy Longjam', 'balajijan96@gmail.com', '9983737263', 'Ongoing', '2016-05-08 16:46:40'),
('CS9', 'Business management system', 'Advance java and DBMS', 'It''s a business management software for the small shops.', 'management business '' small shops software', 'This project is a shop based billing and database management system which keeps track of sales and stocks of a sanitary hardware shop. It consists of GUI in which we can see and manage the sales and stock of the shop. The details of available stock are stored in a DBMS. On shortage of stocks, the system prompts for restocking of the particular item.', '["Database System","Business Process","Management System","Hardware Implementation","Database Management System","Database Design","Hardware Design","Tracking System","Project Manager","Database Query","Available Bandwidth","Database Management","Business Model","Tracking Control","Projection Method","Hardware Accelerator","Hardware Architecture","Database Search","Projection Pursuit","Stock Market","Project Scheduling","Hardware Description Language","Relational Database Management System","Projective Geometry","Management Information System","Database Integration","Guided Tour","Management Science","Stock Price","Hardware Verification","Projection Operator","hardware/software partitioning"]', 'Dr. R. Jebakumar', 'Aditya kamal,Aayush Mehrotra,Ankit Gupta', 'adityakamal123@gmail.com', '8989896777', 'Ongoing', '2016-05-08 16:49:19');
